import React from "react";
import { energyHero } from "../../constants";
import { Link } from "react-router-dom";

const Energy = () => {
  return (
    <section className="h-screen">
      <div className="flex h-full">
        {energyHero.map((item) => {
          return (
            <Link
              to={item.link}
              className="md:w-1/2 h-full relative energysec transition-all duration-300 hover:w-2/3"
            >
              <div className="size-full absolute flex-centralizer">
                <h2>{item.title}</h2>
              </div>
              <img
                src={item.cover}
                alt={item.title}
                className="bg-fullobject h-full"
              />
            </Link>
          );
        })}
      </div>
      <div className="size-full absolute flex-centralizer">
        <h1>Choose one Product</h1>
      </div>
    </section>
  );
};

export default Energy;
